insert into experience 
(Title,Content,SkillID,Exp,StartTime,EndTime,CreateDate) 
values ('webpack.DefinePlugin()配合cross-env配置环境变量','<p>使用cross-env可以在npm script中配置一个变量，用于获取当前环境类型，例如 <span style="color:hsl(0,0%,0%);"><code>"start":&nbsp;“cross-env&nbsp;ENV=prod&nbsp;webpack”</code> &nbsp;之后可以通过 <code>process.env.ENV&nbsp;</code> 来获取到设置的值。</span></p><p><span style="color:hsl(0,0%,0%);">在webpack.config.js中，在plugins中这么写：</span></p><pre><code class="language-plaintext">plugins: [
  new webpack.DefinePlugin({
    "ENV": JSON.stringify(process.env.ENV),
    "URL": JSON.stringify(process.env.URL)
  })
]</code></pre><p>&nbsp;</p><p>这样子的话在编译和打包的时候就会创建全局变量，就可以在浏览器环境获取到对应的环境变量了。</p><p>&nbsp;</p><ul><li><strong>cross-env是设置node环境变量的；</strong></li><li><strong>webpack.DefinePlugin是设置浏览器环境下全局变量的</strong></li></ul><p>&nbsp;</p><p><i>参考资料</i></p><p><a href="https://juejin.im/post/5dfa36f9f265da33c90b47ef"><i>https://juejin.im/post/5dfa36f9f265da33c90b47ef</i></a></p>',41,2,'null','2020-06-08T18:00',now())

